package Keyword;

public class frloops3 {
	
void display() {
		
		for(int i=1;i<=10;i++) {
			
			for(int j=1;j<=10;j++) {
				
				
				System.out.println(i+"*" + j+"="+ i*j);
				
			}
			
		}
	}

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		frloops3 a2 = new frloops3();
		a2.display();

	}

}
